import React from 'react'
import { Link } from 'react-router-dom'

const Nav = ({userRole}) => {
  return (
    <>
        <div className='nav'>
    <ul>

{links[userRole].map((link, index) => (
    <li key={index}>
        <Link to={link.path}>
            {link.label}
        </Link>
    </li>
))}

    </ul>
      
    </div>
    </>
    
  )
}

export default Nav
